import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import './header.css';

import logoImage from '/Users/nicolemerriman/Desktop/wanderlogixs-app/src/assets/images/logo-icon.png'; 

export default function AppHeader() {
    return (
        <>
            <Navbar className="bg-body-tertiary" expand="lg">
                <Container>
                    {/* Logo and Brand */}
                    <Navbar.Brand href="#home" className="d-flex align-items-center header-light-blue-logo text">
                        <img src={logoImage} alt="Logo" style={{ maxWidth: '100px', marginRight: '10px' }} />
                        WanderLogixs
                    </Navbar.Brand>

                    {/* Toggler */}
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />

                    {/* Navbar Links and Search Form */}
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="me-auto">
                            <Nav.Link href="#dashboard">Dashboard</Nav.Link>
                            <Nav.Link href="#trips">Trips</Nav.Link>
                            <Nav.Link href="#expenses">Expenses</Nav.Link>
                            <Nav.Link href="#itinerary">Itinerary</Nav.Link>
                            <Nav.Link href="#media">Media</Nav.Link>
                            <Nav.Link href="#contact" style={{ marginRight: '20px' }}>Contact</Nav.Link>
                        </Nav>
                        <Form className="d-flex ms-auto">
                            <Form.Control
                                type="search"
                                placeholder="Search"
                                className="me-2"
                                aria-label="Search"
                            />
                            <Button type="submit" className="rounded-button">Submit</Button>
                        </Form>
                    </Navbar.Collapse>
                </Container>
            </Navbar>
        </>
    );
}
